import React from 'react';
import { Block, Button } from '../../components';

import "./Auth.scss"

const Auth = () => {
    return (
        <section className="auth">
            <Block className="">
                <Button type="primary" size="large">This is button</Button>
            </Block>
        </section>
    );
};

export default Auth;
